import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navheader from './navbar';
import MySidebar from './sidebar';

function App() {
  return (
    <div className="App">

    <React.Fragment>
    <Navheader />
    <MySidebar />
    </React.Fragment>

    </div>
  );
}

export default App;
